/* eslint-disable */
import '@babel/polyfill';
import mapDispaly from './mapbox';
import login from './login';
import { logout } from './user';
import upDateAccount from './updataUserData';

// dom
const displayMap = document.getElementById('map');
const loginForm = document.getElementById('login-form');
const logoutBtn = document.getElementById('logout');
const upDataDataForm = document.getElementById('form--info--update');

if (displayMap) {
    mapDispaly(JSON.parse(displayMap.dataset.location));
}
if (loginForm) {
    loginForm.addEventListener('submit', login);
}
if (logoutBtn) {
    logoutBtn.addEventListener('click', logout);
}
if (upDataDataForm) {
    upDataDataForm.addEventListener('submit', function(e) {
        e.preventDefault();
        const name = document.getElementById('update--name');
        const email = document.getElementById('update--email');
        upDateAccount(name, email);
    });
}
